import Main from "./components/Main";
import Alphabetslec from "./components/Alphabetslec";
import { BrowserRouter, Route, Switch } from "react-router-dom";

function App() { 
  return (
    <div>
      <BrowserRouter>
        <Route exact path="/">
         <Main />
        </Route>
        <Switch>
          <Route path="/Alphabetslec">
            <Alphabetslec />
          </Route>
        </Switch>
      </BrowserRouter>
    </div>
  )
}

export default App;
